		largo = (int) simplex_array[kTrayectoria][2];
		alto = (int) simplex_array[kTrayectoria][largo + 1] + 6;
		cudaMemcpy(simplex_array[kTrayectoria], h_simplex_array[kTrayectoria], largo*alto*sizeof(double), cudaMemcpyDeviceToHost);
	}

}

